import React from 'react'
import { HiOutlineLogout } from 'react-icons/hi';
import "./Dashboard.css"
const Dash=({handleLogout})=> {


    return (
      <Route exact path="/Events_Display">

        <div className="upper">
           <h1 className="rehead"> Event Submission </h1>

      <iframe allowTransparency="true" className="css-form" width="100%" id="contactform123" name="contactform123" marginwidth="0" marginheight="0" frameborder="0" src="https://form.123formbuilder.com/5990259/form"><p>Your browser does not support iframes. The contact form cannot be displayed. Please use another contact method (phone, fax etc)</p></iframe>
        </div>
      </Route>
    )
}

export default Dash
